import React from "react";

const ListItem = (props) => {
  const { item } = props;
  return (
    <li className="list-group-item d-flex justify-content-between align-items-center">
      {item.place}

      <span className="badge">{item.amount}</span>
    </li>
  );
};

export default ListItem;
